import React from "react";
import { useNavigate } from "react-router-dom";
import espressoImg from "./assets/espresso.png";
import refresherImg from "./assets/refreshercoffee.png";
import teaImg from "./assets/teacoffee.png";
import blendedImg from "./assets/chocolate.png";
import pastryImg from "./assets/pastry.png";
import CartIcon from "./CartIcon";
import "./App.css";

export default function CoffeeShop({ addToCart, totalItems }) {
  const navigate = useNavigate();

  const buttonStyle = {
    border: "2px solid #6f4e37",
    width: "140px",
    height: "240px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    cursor: "pointer",
    background: "#f3e9dc",
    textAlign: "center",
    borderRadius: "12px",
    boxShadow: "4px 4px 8px rgba(111, 78, 55, 0.3)",
    transition: "transform 0.2s ease, box-shadow 0.2s ease",
  };

  const imgStyle = {
    width: "120px",
    height: "120px",
    borderRadius: "12px",
    objectFit: "cover",
    boxShadow: "2px 2px 6px rgba(111, 78, 55, 0.5)",
  };

  const labelStyle = {
    fontFamily: "'Sansita Swashed', cursive",
    marginTop: "15px",
    color: "#6f4e37",
    fontWeight: "700",
    fontSize: "1.1rem",
    background: "#d6bfa6",
    borderRadius: "8px",
    padding: "8px 12px",
    width: "100%",
    border: "2px solid #6f4e37",
    boxShadow: "inset 0 0 5px rgba(111, 78, 55, 0.2)",
  };

  const backButtonStyle = {
    fontSize: "1.7rem",
    cursor: "pointer",
    background: "#6f4e37",
    border: "none",
    borderRadius: "50%",
    width: "55px",
    height: "55px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    color: "#fff",
    boxShadow: "2px 2px 6px rgba(111, 78, 55, 0.6)",
    transition: "background-color 0.3s ease",
  };

  const backButtonHoverStyle = {
    backgroundColor: "#5a3f2d",
  };

  return (
    <div
      style={{
        textAlign: "center",
        fontFamily: "'Roboto', sans-serif",
        backgroundColor: "#fff7f0",
        minHeight: "100vh",
        padding: "1rem 0 3rem",
      }}
    >
      {/* Container for back button + cart icon */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-end",
          gap: "12px",
          width: "100%",
          maxWidth: "820px",
          margin: "0 auto 1.5rem auto",
          padding: "0 1.5rem",
          position: "relative",
        }}
      >
        {/* Back Home Button */}
        <button
          onClick={() => navigate("/")}
          style={backButtonStyle}
          aria-label="Back to Home"
          title="Back to Home"
          onMouseEnter={(e) =>
            (e.currentTarget.style.backgroundColor = backButtonHoverStyle.backgroundColor)
          }
          onMouseLeave={(e) =>
            (e.currentTarget.style.backgroundColor = backButtonStyle.background)
          }
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="28"
            height="28"
            fill="none"
            stroke="currentColor"
            strokeWidth="3"
            strokeLinecap="round"
            strokeLinejoin="round"
            viewBox="0 0 24 24"
          >
            <polyline points="15 18 9 12 15 6" />
          </svg>
        </button>

        {/* Cart Icon */}
        <CartIcon totalItems={totalItems} />
      </div>

      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(140px, 1fr))",
          gap: "2rem",
          maxWidth: "820px",
          margin: "0 auto",
          padding: "0 1rem",
        }}
      >
        {/* Espresso */}
        <button
          onClick={() => navigate("/espresso")}
          style={buttonStyle}
          onMouseEnter={(e) => (e.currentTarget.style.transform = "scale(1.07)")}
          onMouseLeave={(e) => (e.currentTarget.style.transform = "scale(1)")}
        >
          <img src={espressoImg} alt="Espresso" style={imgStyle} />
          <div style={labelStyle}>Espresso</div>
        </button>

        {/* Refresher */}
        <button
          onClick={() => navigate("/refresher")}
          style={buttonStyle}
          onMouseEnter={(e) => (e.currentTarget.style.transform = "scale(1.07)")}
          onMouseLeave={(e) => (e.currentTarget.style.transform = "scale(1)")}
        >
          <img src={refresherImg} alt="Refresher" style={imgStyle} />
          <div style={labelStyle}>Refresher</div>
        </button>

        {/* Tea */}
        <button
          onClick={() => navigate("/tea")}
          style={buttonStyle}
          onMouseEnter={(e) => (e.currentTarget.style.transform = "scale(1.07)")}
          onMouseLeave={(e) => (e.currentTarget.style.transform = "scale(1)")}
        >
          <img src={teaImg} alt="Tea" style={imgStyle} />
          <div style={labelStyle}>Tea</div>
        </button>

        {/* Pastry */}
        <button
          onClick={() => navigate("/pastry")}
          style={buttonStyle}
          onMouseEnter={(e) => (e.currentTarget.style.transform = "scale(1.07)")}
          onMouseLeave={(e) => (e.currentTarget.style.transform = "scale(1)")}
        >
          <img src={pastryImg} alt="Pastry" style={imgStyle} />
          <div style={labelStyle}>Pastry</div>
        </button>

        {/* Blended Beverage */}
        <button
          onClick={() => navigate("/blended")}
          style={buttonStyle}
          onMouseEnter={(e) => (e.currentTarget.style.transform = "scale(1.07)")}
          onMouseLeave={(e) => (e.currentTarget.style.transform = "scale(1)")}
        >
          <img src={blendedImg} alt="Blended Beverage" style={imgStyle} />
          <div style={labelStyle}>Blended Beverage</div>
        </button>
      </div>
    </div>
  );
}
